import './App.css';
import Nav from './Components/Nav/Nav.js';
import Header from './Components/Header/Header.js'
import ImgBackground from './Components/Images/header.jpg'

function App() {
  return (
    <>
    <img class="imgContainer img-fluid" src={ImgHeader} alt="" width="272" height="157"/>
    <Nav/>
    <Header/>
    </>
  );
}

export default App;
